$(function(){var a=new GMaps({el:"#layer",lat:-33.8665433,lng:151.1956316,zoom:15});a.addLayer("places",{location:new google.maps.LatLng(-33.8665433,151.1956316),radius:500,types:["store"],search:function(e,t){if(t==google.maps.places.PlacesServiceStatus.OK)for(var n=0;n<e.length;n++){var o=e[n];a.addMarker({lat:o.geometry.location.lat(),lng:o.geometry.location.lng(),title:o.name,infoWindow:{content:"<h2>"+o.name+"</h2><p>"+(o.vicinity?o.vicinity:o.formatted_address)+'</p><img src="'+o.icon+'"" width="100"/>'}})}}})});